// n8n Code Node - Parse Claude Response
// This code extracts JSON data from Claude's response

// Try different possible paths for the Claude response
let claudeResponse;
try {
  const inputData = $('Market Value Agent').first().json
  //const inputData = $('Market Value Agent').all()[0].json

  // Check various possible response structures
  claudeResponse = inputData.content || 
                 inputData.text || 
                 inputData.response || 
                 inputData.body || 
                 inputData.message || 
                 inputData.output || 
                 inputData;

  console.log('Claude response type:', typeof claudeResponse);
  console.log('Claude response preview:', JSON.stringify(claudeResponse).substring(0, 200));
} catch (error) {
  console.error('Error accessing input data:', error);
  return [{ json: { error: 'Could not access input data' } }];
}

function parseClaudeResponse(response) {
  try {
    // Method 1: If Claude returns pure JSON
    if (typeof response === 'object' && Array.isArray(response)) {
      return response;
    }

    // Method 2: If Claude returns JSON as string
    if (typeof response === 'string') {
      // Try to parse as direct JSON
      try {
        const parsed = JSON.parse(response);
        if (Array.isArray(parsed)) {
          return parsed;
        }
      } catch (e) {
        // Continue to next method
      }

      // Method 3: Extract JSON from markdown code blocks
      const jsonBlockRegex = /```json\s*([\s\S]*?)\s*```/i;
      const match = response.match(jsonBlockRegex);

      if (match && match[1]) {
        try {
          const parsed = JSON.parse(match[1].trim());
          return Array.isArray(parsed) ? parsed : [parsed];
        } catch (e) {
          console.error('Failed to parse JSON from code block:', e);
        }
      }

      // Method 4: Extract JSON array pattern
      const arrayRegex = /\[\s*\{[\s\S]*\}\s*\]/;
      const arrayMatch = response.match(arrayRegex);

      if (arrayMatch) {
        try {
          const parsed = JSON.parse(arrayMatch[0]);
          return parsed;
        } catch (e) {
          console.error('Failed to parse JSON array:', e);
        }
      }

      // Method 5: Look for individual JSON objects
      const objectRegex = /\{[^{}]*(?:\{[^{}]*\}[^{}]*)*\}/g;
      const objects = response.match(objectRegex);

      if (objects) {
        const validObjects = [];
        objects.forEach(obj => {
          try {
            const parsed = JSON.parse(obj);
            validObjects.push(parsed);
          } catch (e) {
            // Skip invalid JSON
          }
        });

        if (validObjects.length > 0) {
          return validObjects;
        }
      }
    }

    // If all methods fail, return empty array
    console.warn('Could not extract valid JSON from Claude response');
    return [];

  } catch (error) {
    console.error('Error parsing Claude response:', error);
    return [];
  }
}

// Parse the response
const extractedData = parseClaudeResponse(claudeResponse);

console.log('Extracted data count:', extractedData.length);
console.log('First item preview:', extractedData[0]);

// Validate and clean the data
const cleanedData = extractedData.map(item => {
  return {
    item_description: item.item_description || '',
    year: item.year || '',
    hours: item.hours || '',
    serial_number: item.serial_number || '',
    dealer: item.dealer || '',
    seller_location: item.seller_location || '',
    phone: item.phone || '',
    price: item.price || '',
    url_to_listing: item.url_to_listing || ''
  };
});

console.log('Cleaned data count:', cleanedData.length);

// Return the results for n8n
if (cleanedData.length === 0) {
  return [{ json: { error: 'No valid equipment data found', raw_response: claudeResponse } }];
}

return cleanedData.map((item, index) => ({
  json: {
    ...item,
    index: index,
    total_count: cleanedData.length
  }
}));

