// n8n Code Node for QuickChart Scatter Plot
// Input: items with "Hours - total" and "Current Price" fields

// Process the input data to extract scatter plot points
const scatterData = [];

// Get the input data - it should be from the "Aggregated Data" node
const inputData = $input.all();

// Check if data is nested under 'data' property
let dataToProcess = [];
if (inputData.length > 0 && inputData[0].json && inputData[0].json.data) {
  // Data is nested under 'data' property
  dataToProcess = inputData[0].json.data;
} else {
  // Data is directly in the items
  dataToProcess = inputData.map(item => item.json);
}

for (const dataItem of dataToProcess) {
  // Extract hours (x-axis)
  const hours = parseInt(dataItem['Hours - total'] || 0);

  // Extract and clean current price (y-axis) - remove $ and convert to float
  let price = dataItem['Current Price'] || '0';
  if (typeof price === 'string') {
    price = price.replace(/[$,]/g, ''); // Remove $ and commas
  }
  const currentPrice = parseFloat(price) || 0;

  // Add to scatter data if both values are valid
  if (hours > 0 && currentPrice > 0) {
    scatterData.push({
      x: hours,
      y: currentPrice
    });
  }
}

// Create Chart.js configuration for scatter plot
const scatterChartConfig = {
  type: 'scatter',
  data: {
    datasets: [{
      label: 'Equipment Hours vs Price',
      data: scatterData,
      backgroundColor: 'rgba(54, 162, 235, 0.6)',
      borderColor: 'rgba(54, 162, 235, 1)',
      borderWidth: 1,
      pointRadius: 5
    }]
  },
  options: {
    responsive: true,
    title: {
      display: true,
      text: 'Equipment Hours vs Current Price'
    },
    scales: {
      xAxes: [{
        type: 'linear',
        position: 'bottom',
        scaleLabel: {
          display: true,
          labelString: 'Hours - Total'
        }
      }],
      yAxes: [{
        scaleLabel: {
          display: true,
          labelString: 'Current Price ($)'
        },
        ticks: {
          callback: function(value) {
            return '$' + value.toLocaleString();
          }
        }
      }]
    },
    tooltips: {
      callbacks: {
        label: function(tooltipItem) {
          return 'Hours: ' + tooltipItem.xLabel + ', Price: $' + tooltipItem.yLabel.toLocaleString();
        }
      }
    }
  }
};

// Generate QuickChart URL
const baseUrl = 'https://quickchart.io/chart';
const chartConfigJson = JSON.stringify(scatterChartConfig);
const encodedConfig = encodeURIComponent(chartConfigJson);
const plot_url = `${baseUrl}?c=${encodedConfig}&width=800&height=600`;

// Return the result
return [
  {
    json: {
      plot_url: plot_url,
      data_points: scatterData.length,
      chart_config: scatterChartConfig
    }
  }
];

// n8n Code Node for Creating Individual Histogram Charts
// This creates separate histogram URLs that you can loop through

// Get the transformed data from the Aggregated Data node
const aggregatedNode = $('Aggregated Data').first();
const inputData = aggregatedNode.json.data || [];

// Filter out the AVERAGES row
const cleanData = inputData.filter(item => item.Source !== 'AVERAGES');

console.log(`Processing ${cleanData.length} data items for individual histograms`);

// Helper function to create bins for numerical data
function createBins(values, numBins = 8) {
    if (values.length === 0) return { labels: [], counts: [] };

    const min = Math.min(...values);
    const max = Math.max(...values);
    const binSize = (max - min) / numBins;

    const bins = [];
    const binCounts = new Array(numBins).fill(0);

    for (let i = 0; i < numBins; i++) {
        const binStart = min + (i * binSize);
        const binEnd = min + ((i + 1) * binSize);
        bins.push(`${Math.round(binStart)}-${Math.round(binEnd)}`);
    }

    values.forEach(value => {
        let binIndex = Math.floor((value - min) / binSize);
        if (binIndex >= numBins) binIndex = numBins - 1;
        binCounts[binIndex]++;
    });

    return { labels: bins, counts: binCounts };
}

// Helper function to create categorical histogram
function createCategoricalHistogram(values) {
    const counts = {};

    values.forEach(value => {
        const upperValue = value.toString().toUpperCase();
        counts[upperValue] = (counts[upperValue] || 0) + 1;
    });

    const sortedEntries = Object.entries(counts)
        .sort((a, b) => b[1] - a[1]);

    return {
        labels: sortedEntries.map(entry => entry[0]),
        counts: sortedEntries.map(entry => entry[1])
    };
}

// Helper function to extract numerical values
function extractNumericalValues(values, fieldName) {
    const numericalValues = [];

    values.forEach(value => {
        if (value === '' || value === null || value === undefined) return;

        let cleanValue;
        if (fieldName === 'Current Price') {
            const priceStr = value.toString().replace(/[$,\s]/g, '');
            cleanValue = parseFloat(priceStr);
        } else if (fieldName.includes('%') || fieldName.includes('Resid') || fieldName.includes('YoY')) {
            cleanValue = parseFloat(value.toString().replace(/[%\s]/g, ''));
        } else {
            cleanValue = parseFloat(value.toString().replace(/[^\d.-]/g, ''));
        }

        if (!isNaN(cleanValue) && cleanValue > 0) {
            numericalValues.push(cleanValue);
        }
    });

    return numericalValues;
}

// Define all fields to create histograms for
const fieldsToAnalyze = [
    { field: 'Make', type: 'categorical', color: '#FF6384' },
    { field: 'Model', type: 'categorical', color: '#36A2EB' },
    { field: 'Location', type: 'categorical', color: '#FFCE56' },
    { field: 'Year model', type: 'numerical', color: '#4BC0C0' },
    { field: 'Age', type: 'numerical', color: '#9966FF' },
    { field: 'Hours - total', type: 'numerical', color: '#FF9F40' },
    { field: 'Hours - per year', type: 'numerical', color: '#FF6384' },
    { field: 'Current Price', type: 'numerical', color: '#C9CBCF' },
    { field: 'Price Type', type: 'categorical', color: '#4BC0C0' }
];

// Create individual histogram configurations and URLs
const histogramCharts = [];

fieldsToAnalyze.forEach((fieldConfig, index) => {
    const fieldName = fieldConfig.field;
    const values = cleanData.map(item => item[fieldName]).filter(v => v !== '' && v !== null && v !== undefined);

    if (values.length === 0) {
        console.log(`Skipping ${fieldName} - no valid data`);
        return;
    }

    let chartData;
    let xAxisLabel = fieldName;

    if (fieldConfig.type === 'categorical') {
        chartData = createCategoricalHistogram(values);
    } else {
        const numericalValues = extractNumericalValues(values, fieldName);
        if (numericalValues.length === 0) {
            console.log(`Skipping ${fieldName} - no valid numerical data`);
            return;
        }
        chartData = createBins(numericalValues);

        // Add units to axis labels
        if (fieldName === 'Current Price') xAxisLabel = 'Price Range ($)';
        else if (fieldName.includes('Age')) xAxisLabel = 'Age (Years)';
        else if (fieldName.includes('Hours')) xAxisLabel = 'Hours';
        else if (fieldName.includes('Year')) xAxisLabel = 'Year';
    }

    // Create individual chart configuration
    const chartConfig = {
        type: 'bar',
        data: {
            labels: chartData.labels,
            datasets: [{
                label: 'Count',
                data: chartData.counts,
                backgroundColor: fieldConfig.color,
                borderColor: fieldConfig.color,
                borderWidth: 1
            }]
        },
        options: {
            responsive: true,
            title: {
                display: true,
                text: `${fieldName} Distribution`,
                fontSize: 16,
                fontColor: '#333',
                fontStyle: 'bold'
            },
            scales: {
                yAxes: [{
                    ticks: {
                        beginAtZero: true,
                        stepSize: 1
                    },
                    scaleLabel: {
                        display: true,
                        labelString: 'Count',
                        fontSize: 12
                    }
                }],
                xAxes: [{
                    scaleLabel: {
                        display: true,
                        labelString: xAxisLabel,
                        fontSize: 12
                    },
                    ticks: {
                        maxRotation: 45,
                        fontSize: 10
                    }
                }]
            },
            legend: {
                display: false
            },
            tooltips: {
                callbacks: {
                    title: function(tooltipItems, data) {
                        return `${xAxisLabel}: ${tooltipItems[0].label}`;
                    },
                    label: function(tooltipItem, data) {
                        return `Count: ${tooltipItem.yLabel}`;
                    }
                }
            }
        }
    };

    // Generate URL for this chart
    const chartConfigEncoded = encodeURIComponent(JSON.stringify(chartConfig));
    const chartUrl = `https://quickchart.io/chart?c=${chartConfigEncoded}&width=600&height=400&backgroundColor=white`;

    histogramCharts.push({
        index: index,
        fieldName: fieldName,
        fieldType: fieldConfig.type,
        chartUrl: chartUrl,
        dataCount: values.length,
        uniqueValues: chartData.labels.length,
        chartConfig: chartConfig,
        maxCount: Math.max(...chartData.counts),
        distributionData: {
            labels: chartData.labels,
            counts: chartData.counts
        }
    });

    console.log(`Created histogram for ${fieldName}: ${chartData.labels.length} categories/bins, ${values.length} data points`);
});

// Create summary statistics
const summaryStats = {
    totalRecords: cleanData.length,
    totalHistograms: histogramCharts.length,
    categoricalFields: histogramCharts.filter(h => h.fieldType === 'categorical').length,
    numericalFields: histogramCharts.filter(h => h.fieldType === 'numerical').length,
    fieldSummary: histogramCharts.map(h => ({
        field: h.fieldName,
        type: h.fieldType,
        dataCompleteness: Math.round((h.dataCount / cleanData.length) * 100),
        uniqueValues: h.uniqueValues
    }))
};

// Return array with individual histogram data
return [{
    json: {
        success: true,
        message: `Generated ${histogramCharts.length} individual histogram charts`,
        totalRecords: cleanData.length,
        summaryStats: summaryStats,
        histograms: histogramCharts,
        loopInstructions: {
            howToUse: "Use 'histograms' array in a loop. Each item has a 'chartUrl' property for HTTP Request nodes",
            exampleExpression: "{{ $json.histograms[0].chartUrl }}",
            fieldsAvailable: "fieldName, fieldType, chartUrl, dataCount, uniqueValues, distributionData"
        }
    }
}];

// Data preparation for AI agent - Process all webhook items
const items = $('Webhook').all();

const processedItems = items.map(item => {
  const data = item.json;

  return {
