// CompsCleaner for n8n - JavaScript implementation
// Place this code in a Code node after your Google Sheets node

// Configuration - adjust these values as needed
const CURRENT_YEAR = new Date().getFullYear();

const AMI_AVG =  $('Webhook').first().json.body.amiAverage;// Average annual machine hours

// const SUBJECT_PRICE = $('Gather Assets for Evaluation').first().json['Subject Price']; // Set your subject price here, or pass as parameter
const SUBJECT_PRICE =$('Webhook').first().json.body.subjectPrice;

// Default inflation data (simplified version)
// [$("Add Banfield inflation ratios").item.json.inflation_ratios]
const INFLATION_DATA = $input.first().json.inflation_ratios;

// Helper Functions
function extractState(location) {
    if (!location) return 'USA';
    return 'USA'; // Default to USA - enhance this logic as needed
}

function getRelativeValuePercentage(age) {
    if (age <= 0) return 1.0;
    if (age > 21) return 0.491; // Use last available value for very old equipment

    // Find exact match first
    const exact = INFLATION_DATA.find(item => item.age === age);
    if (exact) return exact.rel_interest_val;

    // Find closest age in inflation data
    const closest = INFLATION_DATA.reduce((prev, curr) => 
        Math.abs(curr.age - age) < Math.abs(prev.age - age) ? curr : prev
    );

    return closest.rel_interest_val;
}

function safePriceToFloat(priceStr) {
    if (!priceStr) return 0.0;

    const priceString = priceStr.toString().trim();

    // Check for auction or call for price
    if (priceString.toUpperCase() === "AUCTION" || 
        priceString.toLowerCase().includes("call for price") ||
        priceString === "{empty}") {
        return 0.0;
    }

    try {
        // Handle USD format like "USD $245,000"
        let cleanPrice = priceString;
        if (cleanPrice.includes('USD')) {
            cleanPrice = cleanPrice.replace('USD', '').trim();
        }

        // Remove currency symbols, commas, and spaces
        cleanPrice = cleanPrice.replace(/[$,\s]/g, '');

        const parsed = parseFloat(cleanPrice);
        return isNaN(parsed) ? 0.0 : parsed;
    } catch (e) {
        return 0.0;
    }
}

// Fixed function to safely extract hours from various formats
function safeHoursToFloat(hoursStr) {
    if (!hoursStr) return 0.0;

    const hoursString = hoursStr.toString().trim();

    // Check for empty values
    if (hoursString === "" || 
        hoursString === "{empty}" || 
        hoursString.toLowerCase() === "null" ||
        hoursString.toLowerCase() === "undefined") {
        return 0.0;
    }

    try {
        // Remove any non-numeric characters except decimal points
        const cleanHours = hoursString.replace(/[^\d.]/g, '');

        if (cleanHours === '') return 0.0;

        const parsed = parseFloat(cleanHours);
        return isNaN(parsed) ? 0.0 : parsed;
    } catch (e) {
        console.log(`Error parsing hours: "${hoursString}"`, e);
        return 0.0;
    }
}

function formatCurrency(amount) {
    return `$${Math.round(amount).toLocaleString()}`;
}

function formatPercentage(percent) {
    return `${Math.round(percent)}%`;
}

// Extract year from item_description (assuming format like "2019 BELL B45E")
function extractYear(description) {
    if (!description) return CURRENT_YEAR;

    // Look for 4-digit year at the beginning
    const yearMatch = description.match(/^(\d{4})/);
    if (yearMatch) {
        const year = parseInt(yearMatch[1]);
        // Validate year is reasonable (between 1990 and current year + 2)
        if (year >= 1990 && year <= CURRENT_YEAR + 2) {
            return year;
        }
    }

    // Fallback: look for any 4-digit number that looks like a year
    const allYears = description.match(/\b(19|20)\d{2}\b/g);
    if (allYears && allYears.length > 0) {
        const year = parseInt(allYears[0]);
        if (year >= 1990 && year <= CURRENT_YEAR + 2) {
            return year;
        }
    }

    return CURRENT_YEAR;
}

// Extract brand from item_description (assuming format like "2019 BELL B45E")
function extractBrand(description) {
    if (!description) return 'Unknown';

    // Remove year first, then get the next word
    const withoutYear = description.replace(/^\d{4}\s*/, '');
    const parts = withoutYear.trim().split(/\s+/);

    return parts.length > 0 ? parts[0] : 'Unknown';
}

// Extract model from item_description (assuming format like "2019 BELL B45E Off-Highway Trucks")
function extractModel(description) {
    if (!description) return 'Unknown';

    // Remove year and brand, get model parts
    const withoutYear = description.replace(/^\d{4}\s*/, '');
    const parts = withoutYear.trim().split(/\s+/);

    if (parts.length > 1) {
        // Get everything after brand, before descriptive terms
        const modelParts = [];
        for (let i = 1; i < parts.length; i++) {
            const part = parts[i];
            if (part.toLowerCase().includes('off-highway') || 
                part.toLowerCase().includes('trucks') ||
                part.toLowerCase().includes('highway')) {
                break;
            }
            modelParts.push(part);
        }
        return modelParts.join(' ') || (parts[1] || 'Unknown');
    }

    return 'Unknown';
}

// Main transformation function
function transformData(items) {
    const transformedItems = [];
    let validPrices = [];
    let validHours = [];
    let validHoursPerYear = [];
    let validResiduals = [];
    let validYoYs = [];
    let valid20Pcts = [];
    let valid35Pcts = [];
    let valid20Vals = [];
    let valid35Vals = [];

    items.forEach((item, index) => {
        const data = item.json;

        // Extract basic information with better error handling
        const year = extractYear(data.item_description);
        const age = CURRENT_YEAR - year;
        const hours = safeHoursToFloat(data.hours); // Fixed hours extraction
        const currentPriceFloat = safePriceToFloat(data.price);

        // Calculate hours per year - only if age > 0 to avoid division by zero
        let hoursPerYear = 0;
        if (age > 0 && hours > 0) {
            hoursPerYear = hours / age;
        }

        // Debug logging - improved
        console.log(`Row ${index + 1}: Hours string: "${data.hours}", Parsed hours: ${hours}, Price string: "${data.price}", Parsed: ${currentPriceFloat}, Year: ${year}, Age: ${age}, Hours/Year: ${hoursPerYear}`);

        // Build transformed row
        const transformedRow = {
            Source: index + 1,
            Make: extractBrand(data.item_description),
            Model: extractModel(data.item_description),
            Location: extractState(data.seller_location || data.location),
            'Year model': year,
            Age: age,
            'Hours - total': hours > 0 ? Math.round(hours) : '', // Show hours if available
            'Hours - per year': (hours > 0 && age > 0) ? Math.round(hoursPerYear) : '', // Show hours per year if calculable
            'Current Price': '',
            'Price Type': '',
            'OEC (estimate)': '',
            Resid: '',
            YoY: '',
            '20%': '',
            '$ Value (20%)': '',
            '35%': '',
            '$ Value (35%)': '',
            Notes: '',
            'Effective Age': 0
        };

        // Check if this is an auction item
        const isAuction = !data.price || 
                         data.price.toString().toUpperCase() === "AUCTION" || 
                         data.price.toString().toLowerCase().includes("call for price") ||
                         data.price.toString() === "{empty}" ||
                         currentPriceFloat === 0;

        if (isAuction) {
            transformedRow['Current Price'] = "AUCTION";
            transformedRow['Price Type'] = "Auction";
            transformedRow['OEC (estimate)'] = "";
            transformedRow['Resid'] = "";
            transformedRow['YoY'] = "";
            transformedRow['20%'] = "";
            transformedRow['$ Value (20%)'] = "";
            transformedRow['35%'] = "";
            transformedRow['$ Value (35%)'] = "";
        } else {
            transformedRow['Current Price'] = formatCurrency(currentPriceFloat);
            transformedRow['Price Type'] = "Retail";

            // Calculate valuation metrics only for non-auction items
            if (currentPriceFloat > 0 && age >= 0) {
                const relValuePct = getRelativeValuePercentage(age);
                const oec = age > 0 ? (SUBJECT_PRICE * relValuePct) : SUBJECT_PRICE;
                const resid = oec > 0 ? (currentPriceFloat / oec) * 100 : 100;
                const yoy = age > 0 ? ((1 - (resid / 100)) / age) * 100 : 0;
                const pct20 = resid * (1 - 0.2);
                const val20 = oec * (resid / 100) * (1 - 0.2);
                const pct35 = resid * (1 - 0.35);
                const val35 = oec * (resid / 100) * (1 - 0.35);

                transformedRow['OEC (estimate)'] = formatCurrency(oec);
                transformedRow['Resid'] = formatPercentage(resid);
                transformedRow['YoY'] = `${yoy.toFixed(2)}%`;
                transformedRow['20%'] = formatPercentage(pct20);
                transformedRow['$ Value (20%)'] = formatCurrency(val20);
                transformedRow['35%'] = formatPercentage(pct35);
                transformedRow['$ Value (35%)'] = formatCurrency(val35);

                // Collect for averages
                validPrices.push(currentPriceFloat);
                validResiduals.push(resid);
                validYoYs.push(yoy);
                valid20Pcts.push(pct20);
                valid35Pcts.push(pct35);
                valid20Vals.push(val20);
                valid35Vals.push(val35);
            }
        }

        // Calculate Effective Age - fixed logic
        if (hours > 0 && age > 0 && AMI_AVG > 0) {
            const effectiveAge = age * (1 + ((hoursPerYear - AMI_AVG) / AMI_AVG));
            transformedRow['Effective Age'] = effectiveAge.toFixed(1);
            validHoursPerYear.push(hoursPerYear);
        } else {
            transformedRow['Effective Age'] = age.toString();
        }

        // Collect valid data for averages
        if (hours > 0) validHours.push(hours);

        transformedItems.push({ json: transformedRow });
    });

    // // Calculate averages
