// Get input data - Fixed to handle different input structures
const inputData = $input.all();

// Enhanced function to extract JSON from various formats
function extractJSON(rawData) {
  let jsonString = '';

  console.log('Raw data type:', typeof rawData);
  console.log('Raw data keys:', Object.keys(rawData || {}));

  // Handle different input structures
  if (typeof rawData === 'string') {
    jsonString = rawData;
  } else if (rawData && rawData.json) {
    // Handle n8n json structure
    if (typeof rawData.json === 'string') {
      jsonString = rawData.json;
    } else if (rawData.json.output) {
      jsonString = rawData.json.output;
    } else {
      jsonString = JSON.stringify(rawData.json);
    }
  } else if (rawData && rawData.output) {
    jsonString = rawData.output;
  } else if (rawData && rawData.data) {
    jsonString = typeof rawData.data === 'string' ? rawData.data : JSON.stringify(rawData.data);
  } else {
    jsonString = JSON.stringify(rawData);
  }

  // Clean up the JSON string - handle markdown code blocks
  jsonString = jsonString.replace(/^```json\s*\n?/, '').replace(/\n?```\s*$/, '');
  jsonString = jsonString.replace(/^```\s*\n?/, '').replace(/\n?```\s*$/, '');

  console.log('Extracted JSON string length:', jsonString.length);
  console.log('First 200 chars:', jsonString.substring(0, 200));

  return jsonString.trim();
}

// Enhanced function to safely parse JSON with better fallbacks
function safeParseJSON(jsonString) {
  try {
    // First try direct parsing
    const parsed = JSON.parse(jsonString);
    console.log('Successfully parsed JSON');
    return parsed;
  } catch (error) {
    console.log('Initial JSON parse failed:', error.message);

    // Try to find JSON object in the string
    const jsonMatch = jsonString.match(/\{[\s\S]*\}/);
    if (jsonMatch) {
      try {
        const parsed = JSON.parse(jsonMatch[0]);
        console.log('Successfully parsed extracted JSON object');
        return parsed;
      } catch (nestedError) {
        console.log('Nested JSON parse failed:', nestedError.message);
      }
    }

    // Manual extraction with improved regex patterns
    console.log('Attempting manual extraction');
    const result = {
      equipment_analysis: {
        equipment_name: 'Default Equipment',
        initial_cost: 100000,
        useful_life: 5,
        salvage_value: 10000,
        macrs_class: '5-year',
        description: 'Equipment analysis'
      },
      depreciation_calculations: {
        years: [0, 1, 2, 3, 4, 5],
        straight_line: [100000, 82000, 64000, 46000, 28000, 10000],
        double_declining: [100000, 60000, 36000, 21600, 12960, 10000],
        sum_of_years_digits: [100000, 70000, 46000, 28000, 16000, 10000],
        macrs: [100000, 80000, 48000, 28800, 17280, 17280]
      }
    };

    // Try to extract actual values from the string
    try {
      const equipmentMatch = jsonString.match(/"equipment_name":\s*"([^"]+)"/);
      if (equipmentMatch) result.equipment_analysis.equipment_name = equipmentMatch[1];

      const costMatch = jsonString.match(/"initial_cost":\s*(\d+)/);
      if (costMatch) result.equipment_analysis.initial_cost = parseInt(costMatch[1]);

      const lifeMatch = jsonString.match(/"useful_life":\s*(\d+)/);
      if (lifeMatch) result.equipment_analysis.useful_life = parseInt(lifeMatch[1]);

      const salvageMatch = jsonString.match(/"salvage_value":\s*(\d+)/);
      if (salvageMatch) result.equipment_analysis.salvage_value = parseInt(salvageMatch[1]);

      const macrsMatch = jsonString.match(/"macrs_class":\s*"([^"]+)"/);
      if (macrsMatch) result.equipment_analysis.macrs_class = macrsMatch[1];

      // Extract arrays with better error handling
      const slMatch = jsonString.match(/"straight_line":\s*\[([^\]]+)\]/);
      if (slMatch) {
        try {
          const numbers = slMatch[1].split(',').map(n => {
            const num = parseInt(n.trim());
            return isNaN(num) ? 0 : num;
          });
          if (numbers.length > 0) result.depreciation_calculations.straight_line = numbers;
        } catch (e) {
          console.log('Failed to parse straight_line array');
        }
      }

      const ddbMatch = jsonString.match(/"double_declining":\s*\[([^\]]+)\]/);
      if (ddbMatch) {
        try {
          const numbers = ddbMatch[1].split(',').map(n => {
            const num = parseInt(n.trim());
            return isNaN(num) ? 0 : num;
          });
          if (numbers.length > 0) result.depreciation_calculations.double_declining = numbers;
        } catch (e) {
          console.log('Failed to parse double_declining array');
        }
      }

      const sydMatch = jsonString.match(/"sum_of_years_digits":\s*\[([^\]]+)\]/);
      if (sydMatch) {
        try {
          const numbers = sydMatch[1].split(',').map(n => {
            const num = parseInt(n.trim());
            return isNaN(num) ? 0 : num;
          });
          if (numbers.length > 0) result.depreciation_calculations.sum_of_years_digits = numbers;
        } catch (e) {
          console.log('Failed to parse sum_of_years_digits array');
        }
      }

      const macrsArrayMatch = jsonString.match(/"macrs":\s*\[([^\]]+)\]/);
      if (macrsArrayMatch) {
        try {
          const numbers = macrsArrayMatch[1].split(',').map(n => {
            const num = parseInt(n.trim());
            return isNaN(num) ? 0 : num;
          });
          if (numbers.length > 0) result.depreciation_calculations.macrs = numbers;
        } catch (e) {
          console.log('Failed to parse macrs array');
        }
      }

      // Update years array based on actual data length
      const maxLength = Math.max(
        result.depreciation_calculations.straight_line.length,
        result.depreciation_calculations.double_declining.length,
        result.depreciation_calculations.sum_of_years_digits.length,
        result.depreciation_calculations.macrs.length
      );
      result.depreciation_calculations.years = Array.from({length: maxLength}, (_, i) => i);

    } catch (extractError) {
      console.log('Manual extraction failed:', extractError.message);
    }

    return result;
  }
}

// Build chart datasets
function buildChartDatasets(depreciationData) {
  return [
    {
