    }
  ];
}

// Generate chart labels dynamically
function generateChartLabels(yearsArray) {
  return yearsArray.map(year => `Year ${year}`);
}

// Generate QuickChart URL with error handling
function createQuickChartUrl(equipmentName, depreciationData) {
  try {
    const chartConfig = {
      type: 'line',
      data: {
        labels: generateChartLabels(depreciationData.years || []),
        datasets: buildChartDatasets(depreciationData)
      },
      options: {
        title: {
          display: true,
          text: `${equipmentName} - Depreciation Comparison`,
          fontSize: 16
        },
        scales: {
          yAxes: [{
            scaleLabel: {
              display: true,
              labelString: 'Book Value ($)'
            },
            ticks: {
              callback: function(value) {
                return '$' + value.toLocaleString();
              }
            }
          }],
          xAxes: [{
            scaleLabel: {
              display: true,
              labelString: 'Year'
            }
          }]
        },
        legend: {
          display: true,
          position: 'top'
        },
        responsive: true
      }
    };

    const configString = JSON.stringify(chartConfig);
    const encodedConfig = encodeURIComponent(configString);
    return `https://quickchart.io/chart?c=${encodedConfig}`;
  } catch (error) {
    console.log('Error creating chart URL:', error.message);
    return 'https://quickchart.io/chart?c=%7B%22type%22%3A%22line%22%7D';
  }
}

