console.log('Processing', inputData.length, 'items');

for (let i = 0; i < inputData.length; i++) {
  try {
    const item = inputData[i];
    console.log(`Processing item ${i}:`, Object.keys(item));

    // Extract JSON string
    const jsonString = extractJSON(item);

    if (!jsonString) {
