  let jsonString = '';

  if (typeof rawData === 'string') {
    jsonString = rawData;
  } else if (rawData && rawData.output) {
    jsonString = rawData.output;
  } else if (rawData && rawData.json && rawData.json.output) {
    jsonString = rawData.json.output;
  } else if (Array.isArray(rawData) && rawData.length > 0) {
    const firstItem = rawData[0];
    if (firstItem.output) {
      jsonString = firstItem.output;
    } else if (firstItem.json && firstItem.json.output) {
      jsonString = firstItem.json.output;
    } else {
      jsonString = JSON.stringify(firstItem);
    }
  } else {
    jsonString = JSON.stringify(rawData);
  }

  // Clean up the JSON string - remove ```json wrapper
  jsonString = jsonString.replace(/^```json\n?/, '').replace(/\n?```$/, '');

  return jsonString;
}

// Function to safely parse JSON with error handling
function safeParseJSON(jsonString) {
  try {
    return JSON.parse(jsonString);
  } catch (error) {
    console.log('JSON parse failed:', error.message);
    console.log('Attempting to repair JSON...');

    // Try to find the last complete JSON object
    let braceCount = 0;
    let lastCompleteIndex = -1;

    for (let i = 0; i < jsonString.length; i++) {
      if (jsonString[i] === '{') {
        braceCount++;
      } else if (jsonString[i] === '}') {
        braceCount--;
        if (braceCount === 0) {
          lastCompleteIndex = i;
        }
      }
    }

    if (lastCompleteIndex > -1) {
      const repairedJson = jsonString.substring(0, lastCompleteIndex + 1);
      try {
        return JSON.parse(repairedJson);
      } catch (repairError) {
        console.log('Repair failed, using manual extraction');
      }
    }

    // Return basic structure if all parsing fails
    return {
      executive_summary: {
        overview: 'Unable to parse overview from provided data',
        key_findings: [],
        market_conditions: 'Unable to parse market conditions',
        risk_assessment: {
          risks: [],
          mitigation_strategies: []
        },
        recommendations: [],
        next_steps: []
      },
      valuation_details: {
        initial_value: 'Unable to parse initial values',
        '48_month_values': {
          retail: 'Unable to parse',
          market: 'Unable to parse',
          wholesale: 'Unable to parse'
        },
        '60_month_values': {
          retail: 'Unable to parse',
          market: 'Unable to parse',
          wholesale: 'Unable to parse'
        },
        '72_month_values': {
          retail: 'Unable to parse',
          market: 'Unable to parse',
          wholesale: 'Unable to parse'
        }
      }
    };
  }
}

// Function to extract key metrics from the executive summary
function extractKeyMetrics(executiveSummary) {
  const metrics = {
    total_assets_analyzed: 0,
    value_range_min: 0,
    value_range_max: 0,
    high_value_threshold: 500000,
    high_utilization_threshold: 8000,
    portfolio_risk_level: 'Medium'
  };

  try {
    // Extract value ranges from overview
    const overview = executiveSummary.overview || '';
    const valueMatches = overview.match(/\$(\d{1,3}(?:,\d{3})*)/g);
    if (valueMatches && valueMatches.length >= 2) {
      metrics.value_range_min = parseInt(valueMatches[0].replace(/[$,]/g, ''));
      metrics.value_range_max = parseInt(valueMatches[valueMatches.length - 1].replace(/[$,]/g, ''));
    }

    // Extract asset count from key findings
    const keyFindings = executiveSummary.key_findings || [];
    for (const finding of keyFindings) {
      if (finding.includes('equipment') || finding.includes('assets')) {
        const assetMatches = finding.match(/(\d+)/g);
        if (assetMatches) {
          metrics.total_assets_analyzed = Math.max(metrics.total_assets_analyzed, parseInt(assetMatches[0]));
        }
      }
    }

    // Determine risk level based on risks count
    const risks = executiveSummary.risk_assessment?.risks || [];
    if (risks.length >= 5) {
      metrics.portfolio_risk_level = 'High';
    } else if (risks.length >= 3) {
      metrics.portfolio_risk_level = 'Medium';
    } else {
      metrics.portfolio_risk_level = 'Low';
    }

  } catch (error) {
    console.log('Error extracting metrics:', error.message);
  }

  return metrics;
}

// Function to parse valuation ranges into structured data
function parseValuationDetails(valuationDetails) {
  const parsedValuation = {
    time_periods: ['48_month', '60_month', '72_month'],
    value_types: ['retail', 'market', 'wholesale'],
    structured_values: {}
  };

  try {
    // Parse each time period
    for (const period of parsedValuation.time_periods) {
      const periodKey = period + '_values';
      const periodData = valuationDetails[periodKey];

      if (periodData) {
        parsedValuation.structured_values[period] = {};

        for (const valueType of parsedValuation.value_types) {
          const valueString = periodData[valueType] || '';
          const ranges = extractValueRange(valueString);
          parsedValuation.structured_values[period][valueType] = ranges;
        }
      }
    }

    // Parse initial value
    const initialValueString = valuationDetails.initial_value || '';
    parsedValuation.initial_value_range = extractValueRange(initialValueString);

  } catch (error) {
    console.log('Error parsing valuation details:', error.message);
  }

  return parsedValuation;
}

// Helper function to extract value ranges from text
function extractValueRange(text) {
  const range = { min: 0, max: 0 };

  try {
    const valueMatches = text.match(/\$(\d{1,3}(?:,\d{3})*)/g);
    if (valueMatches && valueMatches.length >= 2) {
      range.min = parseInt(valueMatches[0].replace(/[$,]/g, ''));
      range.max = parseInt(valueMatches[valueMatches.length - 1].replace(/[$,]/g, ''));
    } else if (valueMatches && valueMatches.length === 1) {
      const value = parseInt(valueMatches[0].replace(/[$,]/g, ''));
      range.min = value;
      range.max = value;
    }
  } catch (error) {
    console.log('Error extracting value range from:', text);
  }

  return range;
}

// Main processing function
function processExecutiveSummary(rawData) {
  try {
    // Extract and parse JSON
    const jsonString = extractJSON(rawData);
    const parsedData = safeParseJSON(jsonString);

    // Extract key components
    const executiveSummary = parsedData.executive_summary || {};
    const valuationDetails = parsedData.valuation_details || {};

    // Process data
    const keyMetrics = extractKeyMetrics(executiveSummary);
    const parsedValuation = parseValuationDetails(valuationDetails);

    // Build final result structure
    const result = {
      executive_summary: {
        overview: executiveSummary.overview || '',
        key_findings: executiveSummary.key_findings || [],
        market_conditions: executiveSummary.market_conditions || '',
        risk_assessment: {
          risks: executiveSummary.risk_assessment?.risks || [],
          mitigation_strategies: executiveSummary.risk_assessment?.mitigation_strategies || [],
          risk_count: (executiveSummary.risk_assessment?.risks || []).length,
          mitigation_count: (executiveSummary.risk_assessment?.mitigation_strategies || []).length
        },
        recommendations: executiveSummary.recommendations || [],
        next_steps: executiveSummary.next_steps || [],
        recommendation_count: (executiveSummary.recommendations || []).length,
        next_steps_count: (executiveSummary.next_steps || []).length
      },
      valuation_details: {
        initial_value: valuationDetails.initial_value || '',
        '48_month_values': valuationDetails['48_month_values'] || {},
        '60_month_values': valuationDetails['60_month_values'] || {},
        '72_month_values': valuationDetails['72_month_values'] || {},
        parsed_valuation: parsedValuation
      },
      key_metrics: keyMetrics,
      summary_statistics: {
        total_key_findings: (executiveSummary.key_findings || []).length,
        total_risks: (executiveSummary.risk_assessment?.risks || []).length,
        total_mitigations: (executiveSummary.risk_assessment?.mitigation_strategies || []).length,
        total_recommendations: (executiveSummary.recommendations || []).length,
        total_next_steps: (executiveSummary.next_steps || []).length,
        portfolio_risk_level: keyMetrics.portfolio_risk_level,
        value_range: {
          min: keyMetrics.value_range_min,
          max: keyMetrics.value_range_max
        }
      },
      processing_metadata: {
        parsed_at: new Date().toISOString(),
        data_source: 'claude_ai_executive_summary',
        parsing_method: 'automated_json_extraction'
      }
    };

    return result;

  } catch (error) {
    console.error('Error processing executive summary:', error.message);
    throw error;
  }
}

