            insights.push("Model concentration risk assessment");
            break;
        case 'location':
            insights.push(`Equipment distributed across ${histogram.uniqueValues} locations`);
            insights.push("Geographic distribution for risk management");
            break;
        case 'age':
        case 'year model':
            insights.push("Equipment age distribution for replacement planning");
            insights.push("Average fleet age impacts depreciation strategy");
            break;
        case 'hours - total':
        case 'hours - per year':
            insights.push("Usage patterns indicate maintenance scheduling needs");
            insights.push("High-usage equipment may require earlier replacement");
            break;
        case 'current price':
            insights.push("Market value distribution for portfolio valuation");
            insights.push("Price ranges inform budget planning");
            break;
        default:
            insights.push(`Distribution analysis for ${histogram.fieldName}`);
            insights.push("Statistical insights available for decision making");
    }

    return insights;
}

// Helper function to generate key findings
function generateKeyFindings(scatterData, histogramData, depreciationData) {
    const findings = [];

    // Market analysis findings
    if (scatterData.dataPointsCount > 0) {
        findings.push({
            category: "Market Analysis",
            finding: `Successfully analyzed ${scatterData.dataPointsCount} equipment units for price-hours correlation`,
            impact: "Enables data-driven pricing and valuation decisions"
        });
