    // Distribution analysis findings
    if (histogramData.summaryStats) {
        const stats = histogramData.summaryStats;
        findings.push({
            category: "Portfolio Distribution",
            finding: `Portfolio spans ${stats.categoricalFields} categorical and ${stats.numericalFields} numerical dimensions`,
            impact: "Comprehensive understanding of portfolio composition"
        });

        // Data completeness finding
        const avgCompleteness = stats.fieldSummary.reduce((sum, field) => sum + field.dataCompleteness, 0) / stats.fieldSummary.length;
        findings.push({
            category: "Data Quality",
            finding: `Average data completeness: ${Math.round(avgCompleteness)}%`,
            impact: avgCompleteness > 80 ? "High-quality data supports reliable analysis" : "Data gaps may require attention for optimal insights"
        });
    }

    // Depreciation analysis findings
    if (depreciationData.financial_summary) {
        const summary = depreciationData.financial_summary;
        findings.push({
            category: "Depreciation Strategy",
            finding: summary.recommended_method || "MACRS method provides optimal tax benefits",
            impact: "Strategic depreciation selection maximizes financial efficiency"
        });
    }

    return findings;
}

