// Helper function to calculate overall data quality score
function calculateDataQualityScore(scatterData, histogramData, depreciationData) {
    let score = 0;
    let maxScore = 0;

    // Scatter plot quality (max 30 points)
    maxScore += 30;
    if (scatterData.chartUrl) score += 20;
    if (scatterData.dataPointsCount > 0) score += 10;

    // Histogram quality (max 40 points)
    maxScore += 40;
    if (histogramData.histograms && histogramData.histograms.length > 0) {
        score += 20;
        const avgCompleteness = histogramData.summaryStats?.fieldSummary?.reduce((sum, field) => sum + field.dataCompleteness, 0) / histogramData.summaryStats.fieldSummary.length || 0;
        score += Math.round(avgCompleteness * 20 / 100);
    }

    // Depreciation quality (max 30 points)
    maxScore += 30;
    if (depreciationData.quickchart_url) score += 15;
    if (depreciationData.financial_summary) score += 15;

    return Math.round((score / maxScore) * 100);
}

