const items = $input.all();
const processedItems = [];

for (let i = 0; i < items.length; i++) {
  const item = items[i];

  try {
    // Get the output field from the item - handle multiple possible structures
    let rawOutput = null;

    if (item.json.output) {
      rawOutput = item.json.output;
    } else if (item.json.executive_summary || item.json.valuation_details || item.json.asset_management_table) {
      // Already structured data
      rawOutput = item.json;
    } else {
      // Try the whole item
      rawOutput = item.json;
    }

    // Clean and parse the output string if it's a string
    if (typeof rawOutput === 'string') {
      // Remove markdown code block markers and clean whitespace
      rawOutput = rawOutput
        .replace(/```json\n?/gi, '')
        .replace(/```\n?$/g, '')
        .replace(/^\s+|\s+$/g, '');

      // Fix common JSON issues and handle array formatting
      if (!rawOutput.trim().endsWith('}') && !rawOutput.trim().endsWith(']')) {
        // Attempt to complete truncated JSON
        const openBraces = (rawOutput.match(/{/g) || []).length;
        const closeBraces = (rawOutput.match(/}/g) || []).length;
        const openBrackets = (rawOutput.match(/\[/g) || []).length;
        const closeBrackets = (rawOutput.match(/\]/g) || []).length;

        const missingBraces = openBraces - closeBraces;
        const missingBrackets = openBrackets - closeBrackets;

        // Add missing closing brackets first, then braces
        for (let j = 0; j < missingBrackets; j++) {
          rawOutput += ']';
        }
        for (let j = 0; j < missingBraces; j++) {
          rawOutput += '}';
        }
      }

      // Handle common truncation patterns in the new format
      if (rawOutput.includes('"resid_lo_dollar": [') && !rawOutput.includes(']]')) {
        // Look for incomplete residual arrays and attempt completion
        const lastCompleteValue = rawOutput.match(/"\$\d{1,3}(,\d{3})*"(?!.*"\$)/);
        if (lastCompleteValue && !rawOutput.trim().endsWith('"]')) {
          const insertPoint = rawOutput.lastIndexOf(lastCompleteValue[0]) + lastCompleteValue[0].length;
          rawOutput = rawOutput.substring(0, insertPoint) + ']' + rawOutput.substring(insertPoint).replace(/[,\s]*$/, '') + '}';
        }
      }

      // Parse the JSON with enhanced error handling
      try {
        const parsedData = JSON.parse(rawOutput);

        // Validate the structure has expected sections
        if (!parsedData.executive_summary && !parsedData.valuation_details && !parsedData.asset_management_table) {
          throw new Error('Missing expected executive_summary, valuation_details, or asset_management_table sections');
