            parsing_method: 'json_extraction',
            input_item_index: i,
            total_items: items.length,
            has_asset_table: !!parsedData.asset_management_table,
            residual_periods_count: parsedData.asset_management_table ? 
              (parsedData.asset_management_table.resid_hi_percent ? parsedData.asset_management_table.resid_hi_percent.length : 0) : 0
          }
        };

        processedItems.push({
          json: structuredOutput,
          binary: item.binary || {}
