      } catch (jsonError) {
        console.log(`JSON parsing failed for item ${i}:`, jsonError.message);

        // Attempt manual extraction with updated patterns for new format
        const manualExtraction = extractKeyDataAdvanced(rawOutput);

        const structuredOutput = {
