          agent_type: 'executive_summary',
          error: 'JSON parsing failed',
          error_details: jsonError.message,
          data: manualExtraction.data,
          raw_output_preview: rawOutput.substring(0, 500) + '...',
          metadata: {
            processing_status: 'partial_extraction',
            parsing_method: 'manual_extraction',
            input_item_index: i,
            total_items: items.length,
            extraction_confidence: manualExtraction.confidence,
            has_asset_table: !!(manualExtraction.data && manualExtraction.data.asset_management_table)
          }
        };

        processedItems.push({
          json: structuredOutput,
          binary: item.binary || {}
        });
      }

    } else if (typeof rawOutput === 'object') {
      // If it's already an object, structure it properly
      if (rawOutput.asset_management_table) {
        rawOutput.asset_management_table = validateAndProcessAssetTable(rawOutput.asset_management_table);
      }

      const structuredOutput = {
        success: true,
        timestamp: new Date().toISOString(),
        agent_type: 'executive_summary',
        data: rawOutput,
        metadata: {
