// Helper function to validate and process asset management table
function validateAndProcessAssetTable(assetTable) {
  try {
    // Ensure all required fields are present
    const requiredFields = ['subject_price', 'subject_year', 'hpy_or_mpy', 'resid_hi_percent', 'resid_hi_dollar', 'resid_lo_percent', 'resid_lo_dollar'];
    const processedTable = { ...assetTable };

    // Validate array lengths match
    const arrayFields = ['resid_hi_percent', 'resid_hi_dollar', 'resid_lo_percent', 'resid_lo_dollar'];
    let expectedLength = null;

    for (const field of arrayFields) {
      if (processedTable[field] && Array.isArray(processedTable[field])) {
        if (expectedLength === null) {
          expectedLength = processedTable[field].length;
        } else if (processedTable[field].length !== expectedLength) {
          console.warn(`Array length mismatch in asset_management_table for field: ${field}`);
        }
      }
    }

    // Add computed fields for analysis
    if (processedTable.resid_hi_percent && processedTable.resid_lo_percent) {
      processedTable.periods_count = processedTable.resid_hi_percent.length;
      processedTable.validation_status = 'valid';

      // Calculate period labels (assuming monthly periods starting from month 12)
      processedTable.period_labels = Array.from({ length: processedTable.periods_count }, (_, index) => {
        return `${(index + 1) * 12} months`;
      });
    }

    return processedTable;
  } catch (error) {
    console.error('Error processing asset management table:', error);
    return {
      ...assetTable,
      validation_status: 'error',
      validation_error: error.message
    };
  }
}

