function extractKeyDataAdvanced(rawText) {
  const extracted = {
    executive_summary: {},
    valuation_details: {},
    asset_management_table: {},
    extraction_method: 'advanced_regex_pattern_matching'
  };

  let confidence = 0;
  const maxConfidence = 15; // Increased for new fields

  try {
    // Extract overview with better handling of quotes
    const overviewMatch = rawText.match(/"overview":\s*"((?:[^"\\]|\\.)*)"/s);
    if (overviewMatch) {
      extracted.executive_summary.overview = overviewMatch[1].replace(/\\"/g, '"');
      confidence++;
    }

    // Extract key findings array with improved parsing
    const keyFindingsMatch = rawText.match(/"key_findings":\s*\[([\s\S]*?)\](?=\s*,\s*"|\s*}\s*,|\s*}$)/);
    if (keyFindingsMatch) {
      const findingsText = keyFindingsMatch[1];
      const findings = findingsText
        .split(/",\s*"/)
        .map(f => f.replace(/^"/, '').replace(/"$/, '').replace(/\\"/g, '"').trim())
        .filter(f => f.length > 10);
      extracted.executive_summary.key_findings = findings;
      confidence += 2;
    }

    // Extract asset management table fields with IMPROVED ARRAY EXTRACTION
    const assetFields = {
      'subject_price': 'string',
      'subject_year': 'string', 
      'hpy_or_mpy': 'string',
      'resid_hi_percent': 'array',
      'resid_hi_dollar': 'array',
      'resid_lo_percent': 'array',
      'resid_lo_dollar': 'array'
    };

    for (const [field, type] of Object.entries(assetFields)) {
      if (type === 'string') {
        const fieldMatch = rawText.match(new RegExp(`"${field}":\\s*"([^"]*)"`, 's'));
        if (fieldMatch) {
          extracted.asset_management_table[field] = fieldMatch[1];
          confidence++;
        }
      } else if (type === 'array') {
        // IMPROVED ARRAY EXTRACTION - handles multi-line arrays and nested brackets
        const arrayMatch = rawText.match(new RegExp(`"${field}":\\s*\\[(.*?)\\](?=\\s*[,}])`, 's'));
        if (arrayMatch) {
          try {
            // First try direct JSON parsing
            const arrayString = '[' + arrayMatch[1] + ']';
            const parsedArray = JSON.parse(arrayString);
            extracted.asset_management_table[field] = parsedArray;
            confidence++;
          } catch (e) {
            // Enhanced manual array extraction for complex cases
            let arrayContent = arrayMatch[1];

            // Handle different quote styles and formatting
            const values = [];
            let current = '';
            let inQuotes = false;
            let escapeNext = false;

            for (let j = 0; j < arrayContent.length; j++) {
              const char = arrayContent[j];

              if (escapeNext) {
                current += char;
                escapeNext = false;
                continue;
              }

              if (char === '\\') {
                escapeNext = true;
                continue;
              }

              if (char === '"') {
                inQuotes = !inQuotes;
                continue;
              }

              if (!inQuotes && char === ',') {
                if (current.trim()) {
                  values.push(current.trim().replace(/^"|"$/g, ''));
                }
                current = '';
                continue;
              }

              current += char;
            }

            // Add the last value
            if (current.trim()) {
              values.push(current.trim().replace(/^"|"$/g, ''));
            }

            // Filter out empty values and clean up
            const cleanedValues = values
              .filter(v => v.length > 0)
              .map(v => {
                // Handle numeric values vs. string values
                if (field.includes('percent')) {
                  return v.replace('%', '');
                } else if (field.includes('dollar')) {
                  return v.replace(/[\$,]/g, '');
                }
                return v;
              });

            if (cleanedValues.length > 0) {
              extracted.asset_management_table[field] = cleanedValues;
              confidence++;
            }
          }
        } else {
          // FALLBACK: Look for arrays split across multiple lines
          const multiLinePattern = new RegExp(`"${field}":\\s*\\[([\\s\\S]*?)(?=\\],|\\}|"\\w+":)`, 's');
          const multiLineMatch = rawText.match(multiLinePattern);
          if (multiLineMatch) {
            const content = multiLineMatch[1];
            const values = content
              .split(/,|\n/)
              .map(v => v.replace(/["\s]/g, '').replace(/[\$,]/g, ''))
              .filter(v => v.length > 0 && v !== ']');

            if (values.length > 0) {
              extracted.asset_management_table[field] = values;
              confidence++;
            }
          }
        }
      }
    }

    // Extract market conditions
    const marketMatch = rawText.match(/"market_conditions":\s*"((?:[^"\\]|\\.)*)"/s);
    if (marketMatch) {
      extracted.executive_summary.market_conditions = marketMatch[1].replace(/\\"/g, '"');
      confidence++;
    }

    // Extract utilization analysis object
    const utilizationMatch = rawText.match(/"utilization_analysis":\s*\{([\s\S]*?)\}(?=\s*,\s*"|\s*}\s*,|\s*}$)/);
    if (utilizationMatch) {
      try {
        const utilizationText = '{' + utilizationMatch[1] + '}';
        const utilizationObj = JSON.parse(utilizationText);
        extracted.executive_summary.utilization_analysis = utilizationObj;
        confidence++;
      } catch (e) {
        // Manual extraction for utilization
        const currentUtil = rawText.match(/"current_utilization":\s*"((?:[^"\\]|\\.)*)"/s);
        const efficiency = rawText.match(/"efficiency_rating":\s*"((?:[^"\\]|\\.)*)"/s);
        const optimization = rawText.match(/"optimization_opportunities":\s*"((?:[^"\\]|\\.)*)"/s);

        if (currentUtil || efficiency || optimization) {
          extracted.executive_summary.utilization_analysis = {};
          if (currentUtil) extracted.executive_summary.utilization_analysis.current_utilization = currentUtil[1];
          if (efficiency) extracted.executive_summary.utilization_analysis.efficiency_rating = efficiency[1];
          if (optimization) extracted.executive_summary.utilization_analysis.optimization_opportunities = optimization[1];
          confidence++;
        }
      }
    }

    // Extract depreciation method recommendation
    const depreciationMatch = rawText.match(/"depreciation_method_recommended":\s*"((?:[^"\\]|\\.)*)"/s);
    if (depreciationMatch) {
      extracted.valuation_details.depreciation_method_recommended = depreciationMatch[1].replace(/\\"/g, '"');
      confidence++;
    }

    // Extract valuation periods (48, 60, 72 month values)
    ['48', '60', '72'].forEach(period => {
      const periodPattern = new RegExp(`"${period}_month_values":\\s*\\{([^}]*)\\}`, 's');
      const periodMatch = rawText.match(periodPattern);
      if (periodMatch) {
        const retailMatch = periodMatch[1].match(/"retail":\s*"([^"]*)"/);
        const marketMatch = periodMatch[1].match(/"market":\s*"([^"]*)"/);
        const wholesaleMatch = periodMatch[1].match(/"wholesale":\s*"([^"]*)"/);

        if (retailMatch || marketMatch || wholesaleMatch) {
          extracted.valuation_details[`${period}_month_values`] = {};
          if (retailMatch) extracted.valuation_details[`${period}_month_values`].retail = retailMatch[1];
          if (marketMatch) extracted.valuation_details[`${period}_month_values`].market = marketMatch[1];
          if (wholesaleMatch) extracted.valuation_details[`${period}_month_values`].wholesale = wholesaleMatch[1];
          confidence++;
        }
      }
    });

    // Extract recommendations array
    const recommendationsMatch = rawText.match(/"recommendations":\s*\[([\s\S]*?)\](?=\s*,\s*"|\s*}\s*,|\s*}$)/);
    if (recommendationsMatch) {
      const recText = recommendationsMatch[1];
      const recommendations = recText
        .split(/",\s*"/)
        .map(r => r.replace(/^"/, '').replace(/"$/, '').replace(/\\"/g, '"').trim())
        .filter(r => r.length > 10);
      extracted.executive_summary.recommendations = recommendations;
      confidence++;
    }

    // Extract next steps
    const nextStepsMatch = rawText.match(/"next_steps":\s*\[([\s\S]*?)\](?=\s*,\s*"|\s*}\s*,|\s*}$)/);
    if (nextStepsMatch) {
      const stepsText = nextStepsMatch[1];
      const nextSteps = stepsText
        .split(/",\s*"/)
        .map(s => s.replace(/^"/, '').replace(/"$/, '').replace(/\\"/g, '"').trim())
        .filter(s => s.length > 10);
      extracted.executive_summary.next_steps = nextSteps;
      confidence++;
    }

    // Post-process asset management table if we have enough data
    if (Object.keys(extracted.asset_management_table).length > 3) {
      extracted.asset_management_table = validateAndProcessAssetTable(extracted.asset_management_table);
    }

  } catch (extractError) {
    console.error('Advanced extraction error:', extractError);
    extracted.extraction_error = extractError.message;
  }

  return {
    success: confidence > 5, // Higher threshold due to more complex structure
    confidence: Math.round((confidence / maxConfidence) * 100),
    data: extracted
  };
}

