// Initialize array to store URLs with print=1
const printUrls = [];

// Helper function to check if URL is from USA (exclude foreign domains)
const isUSUrl = (url) => {
  try {
    const urlObj = new URL(url);
    const hostname = urlObj.hostname.toLowerCase();

    // Exclude common foreign domains
    const foreignDomains = ['.co.uk', '.ca', '.au', '.de', '.fr', '.nl', '.it', '.es', '.jp', '.cn', '.in', '.br'];

    // Check if hostname ends with any foreign domain
    return !foreignDomains.some(domain => hostname.endsWith(domain));
  } catch (error) {
    // If URL parsing fails, fall back to simple string check
    const urlLower = url.toLowerCase();
    const foreignDomains = ['.co.uk', '.ca', '.au', '.de', '.fr', '.nl', '.it', '.es', '.jp', '.cn', '.in', '.br'];
    return !foreignDomains.some(domain => urlLower.includes(domain));
  }
};

// Helper function to add print=1 parameter to URL
const addPrintParam = (url) => {
  try {
    const urlObj = new URL(url);
    urlObj.searchParams.set('print', '1');
    return urlObj.toString();
  } catch (error) {
    // If URL parsing fails, try simple concatenation
    const separator = url.includes('?') ? '&' : '?';
    return url + separator + 'print=1';
  }
};

// Get all items from the "split out data" node
const splitData = $('split out data').all();

// Cycle through each item
for (const item of splitData) {
  const data = item.json;

  // Check all possible URL fields in the data
  const urlFields = ['url', 'sourceUrl', 'favicon', 'ogImage', 'ogUrl', 'link', 'href', 'src'];

  // Check direct URL fields
  urlFields.forEach(field => {
    if (data[field] && typeof data[field] === 'string' && 
        data[field].startsWith('http') && 
        isUSUrl(data[field])) {
      const urlWithPrint = addPrintParam(data[field]);
      printUrls.push(urlWithPrint);
    }
  });

  // Check the links array if it exists
  if (data.links && Array.isArray(data.links)) {
    data.links.forEach(link => {
      if (typeof link === 'string' && 
          link.startsWith('http') && 
          isUSUrl(link)) {
        const urlWithPrint = addPrintParam(link);
        printUrls.push(urlWithPrint);
      } else if (typeof link === 'object') {
        // Check all properties of link object for URLs
        Object.values(link).forEach(value => {
          if (typeof value === 'string' && 
              value.startsWith('http') && 
              isUSUrl(value)) {
            const urlWithPrint = addPrintParam(value);
            printUrls.push(urlWithPrint);
          }
        });
      }
    });
  }

  // Check metadata object if it exists (from your screenshots)
  if (data.metadata && typeof data.metadata === 'object') {
    Object.values(data.metadata).forEach(value => {
      if (typeof value === 'string' && 
          value.startsWith('http') && 
          isUSUrl(value)) {
        const urlWithPrint = addPrintParam(value);
        printUrls.push(urlWithPrint);
      }
    });
  }

  // Check any other fields that might contain URLs
  Object.entries(data).forEach(([key, value]) => {
    // Skip already processed arrays and objects
    if (key === 'links' || key === 'metadata' || urlFields.includes(key)) {
      return;
    }

    if (typeof value === 'string' && 
        value.startsWith('http') && 
        isUSUrl(value)) {
      const urlWithPrint = addPrintParam(value);
      printUrls.push(urlWithPrint);
    } else if (typeof value === 'object' && value !== null && !Array.isArray(value)) {
      // Check nested objects for URLs
      Object.values(value).forEach(nestedValue => {
        if (typeof nestedValue === 'string' && 
            nestedValue.startsWith('http') && 
            isUSUrl(nestedValue)) {
          const urlWithPrint = addPrintParam(nestedValue);
          printUrls.push(urlWithPrint);
        }
      });
    }
  });
}

// Remove duplicates
const uniquePrintUrls = [...new Set(printUrls)];

return [{ json: { printUrls: uniquePrintUrls, count: uniquePrintUrls.length } }];



