// Helper function to safely get and format values
function formatValue(value, type = 'text') {
  if (!value || value === '' || value === null || value === undefined) {
    return '';
  }

  const str = value.toString();

  switch(type) {
    case 'currency':
      const num = parseFloat(str.replace(/[$,%\s]/g, ''));
      return isNaN(num) ? str : '$' + num.toLocaleString();
    case 'percent':
      const pct = parseFloat(str.replace(/[%\s]/g, ''));
      return isNaN(pct) ? str : pct.toFixed(1) + '%';
    case 'number':
      const numVal = parseFloat(str.replace(/[,\s]/g, ''));
      return isNaN(numVal) ? str : numVal.toLocaleString();
    default:
      return str;
  }
}

// Helper function to get field value with multiple possible names
function getField(obj, ...fieldNames) {
  for (let fieldName of fieldNames) {
    if (obj.hasOwnProperty(fieldName) && obj[fieldName] !== null && obj[fieldName] !== undefined && obj[fieldName] !== '') {
      return obj[fieldName];
    }
  }
  return '';
}

// Helper function to parse numeric values from formatted strings
function parseNumericValue(value) {
  if (!value || value === '' || value === null || value === undefined) {
    return null;
  }
  const numStr = value.toString().replace(/[$,%\s]/g, '');
  const num = parseFloat(numStr);
  return isNaN(num) ? null : num;
}

// Calculate YOY percentage
function calculateYOY(currentPrice, oecEstimate) {
  const current = parseNumericValue(currentPrice);
  const oec = parseNumericValue(oecEstimate);
  if (current && oec && oec > 0) {
    return ((current / oec) * 100).toFixed(1) + '%';
  }
  return '';
}

// Calculate percentage-based values
function calculatePercentageValue(baseValue, percentage) {
  const base = parseNumericValue(baseValue);
  const pct = parseNumericValue(percentage);
  if (base && pct) {
    return '$' + Math.round(base * (pct / 100)).toLocaleString();
  }
  return '';
}

