// Helper function to safely get and format values
function formatValue(value, type = 'text') {
  if (!value || value === '' || value === null || value === undefined) {
    return '';
  }

  const str = value.toString();

  switch(type) {
    case 'currency':
      const num = parseFloat(str.replace(/[$,%\s]/g, ''));
      return isNaN(num) ? str : '$' + num.toLocaleString();
    case 'percent':
      const pct = parseFloat(str.replace(/[%\s]/g, ''));
      return isNaN(pct) ? str : pct.toFixed(1) + '%';
    case 'number':
      const numVal = parseFloat(str.replace(/[,\s]/g, ''));
      return isNaN(numVal) ? str : numVal.toLocaleString();
    case 'phone':
      // Format phone number if it looks like one
      const phoneStr = str.replace(/\D/g, '');
      if (phoneStr.length === 10) {
        return `(${phoneStr.slice(0,3)}) ${phoneStr.slice(3,6)}-${phoneStr.slice(6)}`;
      }
      return str;
    case 'url':
      // Truncate long URLs for display
      return str.length > 50 ? str.substring(0, 47) + '...' : str;
    default:
      return str;
  }
}

// Helper function to get field value with multiple possible names
