// Helper Functions
function safePriceToString(priceStr) {
    if (!priceStr) return "";

    const priceString = priceStr.toString().trim();

    // Check for auction or call for price
    if (priceString.toUpperCase() === "AUCTION" || 
        priceString.toLowerCase().includes("call for price") ||
        priceString === "{empty}") {
        return "AUCTION";
    }

    // Return the original price string, cleaned up
    return priceString;
}

function safeHoursToString(hoursStr) {
    if (!hoursStr) return "";

    const hoursString = hoursStr.toString().trim();

    // Check for empty values
    if (hoursString === "" || 
        hoursString === "{empty}" || 
        hoursString.toLowerCase() === "null" ||
        hoursString.toLowerCase() === "undefined") {
        return "";
    }

    return hoursString;
}

// Extract year from item_description (assuming format like "2019 BELL B45E")
function extractYear(description) {
    if (!description) return "";

    // Look for 4-digit year at the beginning
    const yearMatch = description.match(/^(\d{4})/);
    if (yearMatch) {
        const year = parseInt(yearMatch[1]);
        // Validate year is reasonable (between 1990 and current year + 2)
        const currentYear = new Date().getFullYear();
        if (year >= 1990 && year <= currentYear + 2) {
            return year.toString();
        }
    }

    // Fallback: look for any 4-digit number that looks like a year
    const allYears = description.match(/\b(19|20)\d{2}\b/g);
    if (allYears && allYears.length > 0) {
        const year = parseInt(allYears[0]);
        const currentYear = new Date().getFullYear();
        if (year >= 1990 && year <= currentYear + 2) {
            return year.toString();
        }
    }

    return "";
}

// Main transformation function to create market comps list
function createMarketCompsList(items) {
    const marketComps = [];

    items.forEach((item, index) => {
        const data = item.json;

        try {
            // Extract year from description if not provided separately
            const year = data.year || extractYear(data.item_description);

            // Create market comp entry
            const marketComp = {
                item_description: data.item_description || "",
                year: year,
                hours: safeHoursToString(data.hours),
                serial_number: data.serial_number || "",
                dealer: data.dealer || "",
                seller_location: data.seller_location || data.location || "",
                phone: data.phone || "",
                price: safePriceToString(data.price),
                url_to_listing: data.url_to_listing || data.url || ""
            };

            // Only add non-empty entries
            if (marketComp.item_description || marketComp.price) {
                marketComps.push(marketComp);
            }

        } catch (error) {
            console.log(`Error processing item ${index + 1}:`, error);
            // Continue with next item
        }
    });

    return marketComps;
}

