// Helper function to safely parse JSON strings
function safeJsonParse(data) {
  if (typeof data === 'string') {
    try {
      return JSON.parse(data);
    } catch (e) {
      console.log('JSON parse error:', e);
      return data;
    }
  }
  return data;
}

// Helper function to extract data from various node formats
function extractNodeData(nodeData) {
  if (!nodeData) return null;

  // Handle different data structures
  if (Array.isArray(nodeData)) {
    return nodeData.map(item => {
      if (item.json) return item.json;
      return item;
    });
  }

  if (nodeData.json) return nodeData.json;
  return nodeData;
}

// Helper function to format JSON properly without \n issues
function formatJsonOutput(data) {
  if (typeof data === 'string') {
    // Try to parse and re-stringify to clean up formatting
    try {
      const parsed = JSON.parse(data);
      return JSON.stringify(parsed, null, 2);
    } catch (e) {
      // If parsing fails, return cleaned string
      return data.replace(/\\n/g, '\n').replace(/\\\"/g, '"');
    }
  }

  if (typeof data === 'object' && data !== null) {
    return JSON.stringify(data, null, 2);
  }

  return data;
}

// Helper function to remove formatting from residual values
function cleanResidualValues(data) {
  if (!data || typeof data !== 'object') return data;

  // Create a deep copy to avoid modifying original data
  const cleanedData = JSON.parse(JSON.stringify(data));

  // Function to recursively clean values
  function cleanValue(value) {
    if (typeof value === 'string') {
      // Remove $ and % symbols, keep the numeric value
      return value.replace(/[$%,]/g, '');
    } else if (Array.isArray(value)) {
      return value.map(cleanValue);
    } else if (typeof value === 'object' && value !== null) {
      const cleaned = {};
      for (const [key, val] of Object.entries(value)) {
        cleaned[key] = cleanValue(val);
      }
      return cleaned;
    }
    return value;
  }

  // Clean specific residual value fields
  if (cleanedData.asset_management_table) {
    const table = cleanedData.asset_management_table;

    // Clean residual percentage and dollar arrays
    if (table.resid_hi_percent) {
      table.resid_hi_percent = table.resid_hi_percent.map(val => val.replace('%', ''));
    }
    if (table.resid_hi_dollar) {
      table.resid_hi_dollar = table.resid_hi_dollar.map(val => val.replace(/[$,]/g, ''));
    }
    if (table.resid_lo_percent) {
      table.resid_lo_percent = table.resid_lo_percent.map(val => val.replace('%', ''));
    }
    if (table.resid_lo_dollar) {
      table.resid_lo_dollar = table.resid_lo_dollar.map(val => val.replace(/[$,]/g, ''));
    }

    // Clean subject_price
    if (table.subject_price) {
      table.subject_price = table.subject_price.replace(/[$,]/g, '');
    }
  }

  // Clean valuation_details
  if (cleanedData.valuation_details && cleanedData.valuation_details['48_month_values']) {
    const values = cleanedData.valuation_details['48_month_values'];
    if (values.retail) {
      values.retail = values.retail.replace(/[$,]/g, '').split(' ')[0]; // Keep only the numeric part
    }
    if (values.market) {
      values.market = values.market.replace(/[$,]/g, '').split(' ')[0]; // Keep only the numeric part
    }
  }

  return cleanedData;
}

